import React from 'react';
import DeleteColumn from './DeleteColumn';
import CreateCard from './CreateCard';

export default ({ id, title, cards, fetchColumns }) => {
  console.log(cards[0].title)
  return (
    <div className="column-item">
        <div className="d-flex justify-content-between">
            <p className="p-3 m-0">{title}</p>
            <CreateCard columnId={id}/>

            {/* <button className="fas fa-plus m-2" data-toggle="modal" data-target="#addNewCard"></button> */}
        </div>

        <DeleteColumn id={id} fetchColumns={fetchColumns}/> 
    </div>
  );
}
